import React from 'react';
import LogsPage from './pages/LogsPage';
import SearchPage from './pages/SearchPage';
import AlertsPage from './pages/AlertsPage';
import IndexPage from './pages/IndexPage';
import SignupPage from './pages/SignupPage';
import SigninPage from './pages/SigninPage';

export default function App(){
  const [route, setRoute] = React.useState('index');
  const [user, setUser] = React.useState(null);
  function handleAuth(info){ setUser(info); setRoute('logs'); }
  return (
        <Router>
          <Routes>
            <Route path="/" element={<HomeLayout><IndexPage user={user} onNavigate={setRoute}/></HomeLayout>} />
            <Route path="/signup" element={<SignupPage onNavigate={setRoute} />} />
            <Route path="/signin" element={<SigninPage onAuth={handleAuth} onNavigate={setRoute} />} />
            <Route path="/logs" element={<HomeLayout><LogsPage/></HomeLayout>} />
            <Route path="/search" element={<HomeLayout><SearchPage/></HomeLayout>} />
            <Route path="/alerts" element={<HomeLayout><AlertsPage/></HomeLayout>} />
          </Routes>
        </Router>
  );
}
